  return (
    <div className="App">
      <img src={DE2} alt="imagem da placa DE2"></img>
      <div className='container'>
          <div className='row1'>
            <div className='blank'/>
            <div className='blank'/>
            <div className='blank'/>
          </div>
          <div className='row2'>
            <div className='blank'/>
            <DE2Component/>
            <div className='blank'/>
          </div>
          <div className='row3'>
            <div className='blank'/>
            <LedEditor/>
            <div className='blank'/>
          </div>
      </div>
    </div>
  );
}

export default App;
